r>\r\n        <br>\r\n        <br>\r\n        <br>\r\n        <br>\r\n        <br>\r\n        <br>\r\n        <br>\r\n        <h2>Inukshuk</h2>\r\n        <p>\r\n            Inukshuk was born sometime during the Winter Season of 2002-2003 in the wild. At only a couple months old he was orphaned. He has fathered 5 cubs total (Ganuk, Hudson, Taiga, Juno, and Humphrey). He started living at the Habitat part-time in 2012 and has been living full time since 2016. He enjoys eating beaver unlike the other bears at the Habitat.\r\n        </p>\r\n        <div class=\"inukshuk\">\r\n            <img src=\"images/bear_inukshuk.png\" style=\"width:500px;height:500px\" align=\"left\">\r\n        </div>\r\n        <br>\r\n    </div>\r\n\r\n\r\n</body>\r\n</html>");
